const Custos = ({ notas }) => {
  let nNotas = [];
  let custos = [];
  // let
  //console.log(notas);
  for (let key in notas) {
    //console.log(notas[key]);
    nNotas.push(notas[key]);
    for (let custo in notas[key]) {
      custos.push(notas[key][custo]);
    }
  }

  return (
    <div>
      {nNotas.map((nota) => (
        <div>
          <h3>{nota.corretora}</h3>
          <h3>{nota.data}</h3>
          <h3>{nota.folha}</h3>
          <h3>{nota["nr. nota"]}</h3>
          <h3>{custos.Total}</h3>
        </div>
      ))}
    </div>
  );
};

export default Custos;
